import React from 'react';

class Question extends React.Component {
  constructor(props) {
  super(props)
  this.state = {
    name: props.name,
    hobby: props.hobby,
    color: props.eyeColor,
    weight:100
    }
  }
  render(){
    return (
      <div>
        <p>{this.props.text}</p>
        <button type="button" name="button">True</button>
        <button type="button" name="button">False</button>
      </div>
    )
  }
}
export default Question;
